import React from 'react';
import './Home.css';

function Home() {
  const projects = [
    { title: 'Meals To Do', description: 'A meal planning app to organize your daily meals efficiently.' },
    { title: 'Crypto Tracker', description: 'Track cryptocurrency prices and market trends in real-time.' },
    { title: 'Flutec', description: 'A tech startup website showcasing innovative solutions.' },
    { title: 'BookDetail-UI', description: 'A user interface for browsing and managing book details.' },
    { title: 'Ecommerce', description: 'An online shopping platform with a seamless user experience.' },
    { title: 'Unichat Course', description: 'A chat application designed for online course discussions.' },
  ];

  return (
    <div className="home">
      <h1>Welcome to My Portfolio</h1>
      <p>Here are some of my projects:</p>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <h2>{project.title}</h2>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
